import React from 'react';
import { Route, Routes } from 'react-router-dom'
import { RoutePaths } from '../../routes/routePaths';
import AllRecipesPage from '../AllRecipesPage/AllRecipesPage';
import FavouriteRecipesPage from '../FavouriteRecipesPage/FavouriteRecipesPage';
import HomePage from '../HomePage/HomePage';
import ProfilePage from '../ProfilePage/ProfilePage';

function AppLayout() {
  return (
    <div className="AppLayout">
        <p>
            main page
        </p>
        <Routes>
            <Route path={RoutePaths.PROFILE}>
                <ProfilePage />
            </Route>
            <Route path={RoutePaths.FAVOURITE_RECIPES}>
                <FavouriteRecipesPage />
            </Route>
            <Route path={RoutePaths.ALL_RECIPES}>
                <AllRecipesPage />
            </Route>
            <Route path="/">
                <HomePage />
            </Route>
        </Routes>
    </div>
  );
}

export default AppLayout;
